import HomeJ from './homeJ';
import Moredetails from './moredetails';
import LoginJ from './loginJ';
import SignOnJ from './signOnJ';
import AddRJ from './addRJ';
import ListJ from './listJ';
import { useEffect, useState } from 'react';
import axios from 'axios';

export const Routing = () => {
    const [myrecipe,setmyrecipe]=useState([])
    useEffect(function(){
      axios.get('http://localhost:1234/Recipes/getAll').then(l=>{setmyrecipe(l.data)})
    },[])
    c
  return <BrowserRouter>
    {/* <Route path='/mynav' element={<Nav></Nav>}></Route> */}
    <Nav></Nav>
    <Routes>
      <Route path="/myhome" element={<HomeJ></HomeJ>}>
      <Route path="mymoredetails/:name/:description/:pic/:level/:duration/:type/:id/:component" element={<Moredetails></Moredetails>}></Route>
      </Route>
      <Route path="/mylogin" element={<LoginJ></LoginJ>}>
      <Route path="myaddr" element={<AddRJ></AddRJ>}></Route>
      </Route>
      <Route path="/mysignon" element={<SignOnJ></SignOnJ>}>
      {/* <Route path="myaddr" element={<AddRJ></AddRJ>}></Route> */}
      </Route>
      <Route path="/mylistusers" element={<ListJ></ListJ>}></Route>
      
    </Routes>
    </BrowserRouter>
}

export default Routing
